(3, 1, 'It was a clunky, metal thing on a yellow and black lanyard.', 1),
(4, 1, 'It was all just a bit clunky and strange and not actually that much fun.', 1),
(5, 1, 'In places the dialogue is so clunky that wincing is involuntary.', 1),
(6, 1, 'Great clunky hunks of dialogue come bursting forth.', 1),
(7, 1, 'Decent actors are made to look inferior as they deliver the clunky dialogue.', 1),
