INSERT INTO `ec_themes` (`ID`, `THEME_NAME`, `THEME_HEADER_HTML`, `THEME_FOOTER_HTML`, `THEME_CSS`, `ACTIVE`) VALUES
(1, 'DEFUALT_THEME', '<div class="container" style="[PAGE_STYLE]">\r\n	<h2>[SECTION_TITLE]</h2>\r\n	<div class="container-body">\r\n		<h3>[SECTION_DESC]</h3>', '	</div>\r\n	<p class="footer">[SECTION_FOOT_DESC]</p>\r\n</div>', 'html { background-color: #FFF; }\r\n.container{\r\n	margin: 10px;\r\n	border: 1px solid #D0D0D0;\r\n	-webkit-box-shadow: 0 0 8px #D0D0D0;\r\n}\r\n.container-body{\r\n	margin: 0 10px 0 10px;\r\n}\r\nh2 {\r\n	color: #444;\r\n	background-color: transparent;\r\n	border-bottom: 1px solid #D0D0D0;\r\n	font-size: 19px;\r\n	font-weight: normal;\r\n	margin: 0 0 14px 0;\r\n	padding: 14px 15px 10px 15px;\r\ncolor: #666;text-shadow: 2px 2px 4px #ccc;\r\n\r\n}\r\nh3 {\r\ncolor: red;    \r\ndisplay: block;\r\n    font-size: 1.17em;\r\n    margin-block-start: 1em;\r\n    margin-block-end: 1em;\r\n    margin-inline-start: 0px;\r\n    margin-inline-end: 0px;\r\n    font-weight: bold;\r\n	text-shadow: 2px 2px 4px #ccc;\r\n}\r\np.footer{\r\n	text-align: right;\r\n	font-size: 11px;\r\n	border-top: 1px solid #D0D0D0;\r\n	line-height: 32px;\r\n	padding: 0 10px 0 10px;\r\n	margin: 20px 0 0 0;\r\n}', 'Y'),
(2, 'ROUND_TABLE_THEME', '<div class="topdiv">\r\n	<div class="sticker" style="width: 97%;">\r\n		<div class="stickerHeading titillium"><h2>[SECTION_TITLE]</h2></div>\r\n		<h3>[SECTION_DESC]</h3>', '		<p class="footer">[SECTION_FOOT_DESC]</p>\r\n	</div>\r\n</div>', 'html { background-color: #CF5300; }\r\n.sticker {\r\n    background-color: white;\r\n    border-radius: 1em;\r\n    box-shadow: 0 0 1.1em #666;\r\n    margin: 1.5em 0 3em;\r\n    opacity: 0.9;\r\n    padding: 1.25em 1.45em 1.25em 1.55em;\r\n}\r\n* {\r\n    font-size: 100%;\r\n    margin: 0;\r\n    outline: medium none;\r\n    padding: 0;\r\n    text-decoration: none;\r\n}\r\n\r\n\r\n.stickerHeading {\r\n    background-color: rgb(229, 218, 214);\r\n    border-top-left-radius: 1em;\r\n    border-top-right-radius: 1em;\r\n    height: 1.3em;\r\n    margin: -2em -1.45em 1.25em -1.55em;\r\n    padding: 0.7em 1em 1.1em 1.75em;\r\n}\r\n.sticker .heading, .sticker h2 {\r\n    color: #a71500;\r\n    font-size: 1.2em;\r\n    font-weight: bold;\r\n    margin: 0.25em 0;\r\n}\r\np.footer{\r\n	text-align: right;\r\n	font-size: 11px;\r\n	border-top: 1px solid #D0D0D0;\r\n	line-height: 32px;\r\n	padding: 0 10px 0 10px;\r\n	margin: 20px 0 0 0;\r\n}', 'Y'),
(3, 'KO_BOX_THEME', '<div class="ko-box" style="padding: 0">\r\n    <h2 style="margin-left:15px;">[SECTION_TITLE]</h2>\r\n    <div class="well">\r\n		<h3 style="margin-top:0px;">[SECTION_DESC]</h3>', '    </div>\r\n	<p class="footer">[SECTION_FOOT_DESC]</p>\r\n</div>', 'html {\r\n    color: #333;\r\n    font-family: "Helvetica Neue",Helvetica,Arial,sans-serif;\r\n    font-size: 14px;\r\n    line-height: 1.42857;\r\nbackground-color:#DDEBF9;\r\n}\r\n.h2 {\r\n    color: inherit;\r\n    font-family: inherit;\r\n    font-weight: 500;\r\n    line-height: 1.1;\r\n    font-size: 2em;\r\n    margin-left:20px;	\r\n}\r\n.well {\r\n    background-color: #f5f5f5;\r\n    border: 1px solid #e3e3e3;\r\n    border-radius: 12px;\r\n    box-shadow: 0 1px 1px rgba(0, 0, 0, 0.05) inset;\r\n    margin-bottom: 20px;\r\n    min-height: 20px;\r\n    padding: 14px;\r\nmargin:10px;\r\n}\r\n* {\r\n    box-sizing: border-box;\r\n}\r\nelement.style {\r\n    padding: 0;\r\n}\r\n*::before, *::after {\r\n    box-sizing: border-box;\r\n}\r\n*::before, *::after {\r\n    box-sizing: border-box;\r\n}\r\n.ko-box {\r\n    width: 98%;float: left;\r\n    min-height: 1px;\r\n    padding-left: 15px;\r\n    padding-right: 15px;\r\n    position: relative;\r\nborder: 1px solid #bbb;\r\nmargin-bottom:20px;\r\nbackground-color: gainsboro;	\r\n}\r\n* {\r\n    box-sizing: border-box;\r\n}\r\np.footer{\r\n	text-align: right;\r\n	font-size: 11px;\r\n	border-top: 1px solid #D0D0D0;\r\n	line-height: 32px;\r\n	padding: 0 10px 0 10px;\r\n	margin: 20px 0 0 0;\r\n}', 'Y');
